class Solution:
    def checkInclusion(self, s1, s2):
        """
        :type s1: str
        :type s2: str
        :rtype: bool
        """
        n, m = len(s1), len(s2)
        if n > m:
            return False
        if s1 == s2 or s1 == "":
            return True
        val = [0 for _ in range(26)]
        tar = [0 for _ in range(26)]
        for i in range(n):
            val[ord(s1[i])-97] += 1
            tar[ord(s2[i])-97] += 1
        for i in range(m-n+1):
            if val == tar:
                return True
            if i < m - n:
                tar[ord(s2[i])-97] -= 1
                tar[ord(s2[i+n])-97] += 1
        return False
    def __init__(self, s1, s2):
        self.s1 = s1
        self.s2 = s2
def main():
    s1 = ""
    s2 = ""
    s = Solution(s1,s2)
    print(s.checkInclusion(s1,s2))

if __name__ == '__main__':
    main()